<template>
    <div class="homepage">
        <NewNavBar
        v-on:clickReportTabFromNav="clickReportTabFromNav"
        v-on:clickCompareTabFromNav="clickCompareTabFromNav"
        :whiteTheme="whiteTheme" />
        <div class="bcg-black"></div>
        <div class="bcg-img">
            <svg width="751" height="751" viewBox="0 0 751 751" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="751" height="751" fill="url(#pattern0)"/>
                <defs>
                <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlink:href="#image0" transform="scale(0.000333333)"/>
                </pattern>
                <image id="image0" width="3000" height="3000" xlink:href="data:image/png;base64,"/>
                </defs>
            </svg>
        </div>
        <div class="highlight-text">
            We make financial reports digestable!
        </div>
        <div class="form-block">
            <div class="nav-input-block">
            <b-form-select v-model="selectedYear" :options="yearList" class="year-input">
            <template v-slot:first>
                <b-form-select-option :value="selectedYear" >{{selectedYear}}</b-form-select-option>
            </template>
            </b-form-select>
            <v-select :options="companyName" v-model="selectedCompany" class="company-input-home" />

            <!-- <b-form-group class="file-input">
                <b-form-file
                id="file-default"
                v-model="file"></b-form-file>
            </b-form-group> -->
            <b-button @click="submitMeta" type="submit" class="submit-btn" >
                <div style="text-decoration:none; color:white;">Submit</div>
            </b-button>

            </div>
        </div>
    </div>
</template>

<script>
import shortid from 'shortid';
import * as d3 from 'd3';
// import vSelect from 'vue-select';
import axios from 'axios';
import NewNavBar from './NewNavBar';

const baseURL = 'https://clip.csie.org/HIVEBACK/api';
export default {
  name: 'NewHomePage',
  components: {
    // vSelect,
    NewNavBar,
  },
  data() {
    return {
      whiteTheme: true,
      id: shortid.generate(),
      selectedCompany: 'Company Name',
      selectedYear: 'Year',
      isError: false,
      selectedCompanyId: '',
      yearList: ['1996', '1997', '1998', '1999', '2000', '2001', '2002', '2003', '2004', '2005', '2006', '2007', '2008', '2009', '2010', '2011', '2012', '2013'],
      reportList: {},
      companyName: [],
      file: null,
    };
  },
  beforeCreate() {
  },
  beforeDestroy() {
  },
  mounted() {
  },
  methods: {
    clickCompareTabFromNav(isClickedCompare) {
      if (isClickedCompare) {
        this.$router.push({ name: 'SelectReport', params: { status: 'compare' } });
      }
    },
    clickReportTabFromNav(isClickedReport) {
      if (isClickedReport) {
        this.$router.push({ name: 'SelectReport', params: { status: 'single' } });
      }
    },
    submitMeta() {
      if (this.selectedCompanyId) {
        this.isError = false;
        this.$router.push({ name: 'SingleReport', params: { reportId: this.selectedCompanyId, file: this.file, flag: 'id' } });
      } else if (this.file) {
        console.log('---Click file---', this.file);
        this.isError = false;
        this.$router.push({ name: 'HelloWorld', params: { reportId: this.selectedCompanyId, file: this.file, flag: 'file' } });
      } else {
        this.isError = true;
      }
      console.log(this.isError);
    },
  },
  watch: {
    selectedYear: {
      handler(n, o) {
        console.log('jmurphy');
        console.log(n);
        this.file = null;
        if (n != 'year') {
          const path = `${baseURL}/reportList?year=${this.selectedYear}`;
          axios
            .get(path)
            .then((response) => {
              // console.log(Object.keys(response.data.reportList));
              this.reportList = response.data.reportList;
              this.companyName = Object.keys(response.data.reportList);
              console.log('companyName', this.companyName);
            })
            .catch((error) => {
              console.log(error);
            });
        }
      },
    },
    selectedCompany: {
      handler(n, o) {
        if (n !== 'company') {
          this.selectedCompanyId = this.reportList[n];
        }
      },
    },
    file: {
      handler(n, o) {
        this.selectedYear = 'Year';
        this.selectedCompany = 'Company Name';
        this.selectedCompanyId = '';
      },
    },
  },
  props: ['title'],
};
</script>

